;; **
;;; ## Distributions
;; **

;; @@
(defn plot-diameter-dist [coll]
  (let [dat {:values (map incntr/log (remove #{0} (temporal-diameter coll t0 tmax :distribution)))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :values]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.5 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "e^x hours"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Temporal diameter distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;inquisitive-cove/plot-diameter-dist</span>","value":"#'inquisitive-cove/plot-diameter-dist"}
;; <=

;; @@
(for [b broadcasters]
  (plot-diameter-dist b))
