;; **
;;; ## Evolution
;; **

;; @@
(defn plot-diameter-evolution [coll]
(let [curr (map :mean (temporal-diameter coll t0 tmax :evolution))
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Hours"]
         [:theme_bw]
         [:ggtitle (str "Average temporal diameter evolution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;inquisitive-cove/plot-diameter-evolution</span>","value":"#'inquisitive-cove/plot-diameter-evolution"}
;; <=

;; @@
(for [b broadcasters]
  (plot-diameter-evolution b))
